INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(10, 'HowToStart', 'Se vocรช chegou atรฉ aqui, seu ambiente de trabalho jรก estรก corretamente instalado e pronto para ser utilizado. Foi instalado o Banco de Dados e foi criado um espaรงo em um servidor para hospedagem dos arquivos que compรตem esse ambiente.</p>\r\n<p>Se for necessรกria uma nova instalaรงรฃo ou uma instalaรงรฃo em outro servidor, consulte as <a href=installation.php>Instruรงรตes de Instalaรงรฃo</a>.</p>\r\n<p>No servidor operante, os arquivos ficam distribuรญdos em pastas de acordo com suas finalidades especรญficas. Essas pastas serรฃo melhor apresentadas ao longo dessa documentaรงรฃo:', 'You are already here, your work environment is ready and ready to be used. The Database was installed and a space was created on a server for hosting the files that make up that environment. </ P>', NULL, NULL);
