INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(13, 'FoldersDescription', 'Para resumir:\r\n<ul>\r\n<li><b>api</b><br />Onde opcionalmente serรฃo armazenadas as APIs de comunicaรงรฃo com sistemas ou equipamentos de terceiros;</li>\r\n<li><b>apps</b><br />Local determinado para armazenamento das aplicaรงรตes desenvolvidas com a utilizaรงรฃo da plataforma;</li>\r\n<li><b>assets</b><br />Como padrรฃo, รฉ a pasta que armazena as imagens e folhas de estilos que podem ser customizadas para cada projeto;</li>\r\n<li><b>core</b><br />Aqui ficam os principais arquivos e rotinas bรกsicas do sistema. ร onde ficam armazenadas as versรตes de produรงรฃo do Bootstrap, da jQuery e da biblioteca Limitless. Nessa pasta ficam tambรฉm todos os plugins utilizados pela plataforma;</li>\r\n<li><b>files</b><br />Espaรงo destinado a armazenar os arquivos controlados pelo Gerenciador de Disco Virtual da plataforma;</li>\r\n<li><b>modules</b><br />Aqui ficam os mรณdulos de manutenรงรฃo interna do sistema: Cadastro de Usuรกrios, Permissรตes, Log etc..</li>\r\n<li><b>widgets</b><br />As Widgets (pequenos aplicativos secundรกrios que podem ser invocados para aparecerem dentro de outras pรกginas no sistema) ficam armazenadas nessa pasta;</li>\r\n<li><b>index.php</b><br />ร o arquivo de entrada que carrega todos os scripts necessรกrios para a montagem desse ambiente.</li>\r\n</ul>\r\nร recomendado que os arquivos que compรตem essas pastas e sรฃo os reponsรกveis pela construรงรฃo do sistema, sejam analizados para uma melhor compreensรฃo do funcionamento da plataforma. Muitas idรฉias e dicas de programaรงรฃo poderรฃo ser colhidas nesses arquivos. Uma atenรงรฃo especial poderรก ser dada aos arquivos que estรฃo nas pastas "Core" e "Modules".', 'Resuming:\r\n<ul>\r\n<li> <b> api </ b> <br /> Where communication APIs are optionally stored with third-party systems or devices; </ li>\r\n<li> <b> apps </ b> <br /> Location set for storing applications built using the platform; </ li>\r\n<li> <b> assets </ b> <br /> By default, it is the folder that stores the images and stylesheets that can be customized for each project; </ li>\r\n<li> <b> core </ b> <br /> Here are the main files and basic system routines. This is where the production versions of Bootstrap, jQuery, and the Limitless library are stored. In this folder are also all the plugins used by the platform; </ li>\r\n<li> <b> files </ b> <br /> Space intended to store files controlled by the platform\'s Virtual Disk Manager; </ li>\r\n<li> <b> modules </ b> <br /> Here are the system\'s internal maintenance modules: User Registration, Permissions, Logging etc. </ li>\r\n<li> Widgets </ b> <br /> Widgets (small secondary applications that can be invoked to appear inside other pages in the system) are stored in this folder; </ li>\r\n</ li> <li> <li> <li> <li> <li> <li> <li> <li>\r\n</ ul>\r\nIt is recommended that the files that compose these folders and are responsible for the construction of the system, be analyzed for a better understanding of the operation of the platform. Many ideas and programming tips can be gathered from these files. Special attention can be given to files in the "Core" and "Modules" folders.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(14, 'HowIgetHere', 'Mas, Como Cheguei Aqui?', 'But how did I get here?', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(15, 'HowYouGetHere', 'Como vocรช jรก chegou aqui, percebeu que apรณs o "<b>Login</b>", essa pรกgina foi carregada. <b>Como?</b> Simples: Existe no mรณdulo "<b>Opรงรตes do Sistema</b>", que fica no grupo de mรณdulos "<b>Manutenรงรฃo</b>" uma opรงรฃo chamada "<b>Aplicaรงรฃo Inicial</b>". Nesse campo, qualquer pรกgina pertencente do sistema, sub-sistema ou atรฉ mesmo uma aplicaรงรฃo externa de terceiros, poderรก ser cadastrada para ser carregada na รกrea principal, na abertura do sistema. Experimente preencher com "<b>http://www.oglobo.com.br</b>". Ao entrar no sistema, a pรกgina do Jornal "<b>O Globo</b>" aparecerรก na รกrea principal do sistema.', 'As you arrived here, you noticed that after the "<b> Login </ b>", this page was loaded. <b> How to? </ b> Simple: There is an option called "<b> Maintenance </ b> in the" <b> System Options </ b> Initial Application </ b> ". In this field, any page belonging to the system, sub-system or even a third-party external application can be registered to be loaded in the main area at the system opening. Try filling in with "<b> http://www.oglobo.com.br </ b>". When you enter the system, the "<b> O Globo </ b>" page will appear in the main area of the system.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(16, 'MyAppHere', 'Colocando Minha Aplicaรงรฃo Aqui', 'Placing My Application Here', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(17, 'YourAppHere', 'Se a sua <b>aplicaรงรฃo foi desenvolvida fora da plataforma</b> (em qualquer linguagem, em qualquer servidor etc.) <b>รฉ sรณ apontar a URL de inรญcio</b> da mesma como foi feito com a pรกgina do Jornal "O Globo" no exemplo acima. Mas se vocรช deseja desenvolver uma <b>nova aplicaรงรฃo no mesmo ambiente do sistema</b>, vocรช deve criar uma <b>sub-pasta</b> dentro da pasta "\\<b>apps</b>" para armazenar os arquivos que farรฃo parte dessa aplicaรงรฃo. Seu <b>sub-sistema</b> poderรก ser desenvolvido <b>em qualquer linguagem de programaรงรฃo</b> suportada pelo servidor onde estรก hospedado o sistema. Nesse caso, vocรช terรก acesso aos "plugins" (dezenas de componentes, ร biblioteca "Bootstrap", รs rotinas "jQuery" e "mashups" da biblioteca "Limitness"), alรฉm das <b>funcรตes de programaรงรฃo</b> (desenvolvidas em "PHP" e "Javascript") que farรฃo com que suas tarefas de programaรงรฃo sejam mais rรกpidas, seguras e tenham um melhor desempenho.', 'If your <b> application was developed off-platform </ b> (in any language, on any server, etc.) <b> just point to the start URL </ b> of the same as was done with the "O Globo" newspaper in the above example. But if you want to develop a <b> new application in the same system environment </ b>, you should create a <b> subfolder </ b> in the "\\ <b> apps" folder to store the files that will be part of that application. Your <b> sub-system </ b> can be developed <b> in any programming language </ b> supported by the server where the system is hosted. In this case, you will have access to the "plugins" (dozens of components, the Bootstrap library, the "jQuery" and "mashups" routines of the "Limitness" library), in addition to <b> programming functions </ b> ( developed in "PHP" and "Javascript") that will make your programming tasks faster, safer and perform better.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(18, 'TheNextStep', 'Qual O Prรณximo Passo?', 'What\'s The Next Step', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(19, 'GoToTemplate', 'Uma vez criada a sub-pasta onde seus arquivos serรฃo colocados, o prรณximo passo para desenvolver uma aplicaรงรฃo usando a identidade visual e as extensรตes da plataforma serรก conhecer a <b>vasta lista de funcionalidades que estรฃo disponรญveis</b> para vocรช. Como <b>esse tutorial รฉ baseado em exemplos</b>, o que deve ser feito รฉ analisar um "template" (modelo) que รฉ disponibilizado para esse fim e <b>seguir/aplicar</b> as <b>regras/funรงรตes</b> que serรฃo apresentadas ร seguir para <b>desenvolver a sua prรณpria aplicaรงรฃo de forma rรกpida e intuitiva</b>.', 'Once you have created the subfolder where your files will be placed, the next step in developing an application using the visual identity and extensions of the platform will be to get to know the vast list of features that are available to you. As <b> this tutorial is based on examples </ b>, what should be done is to analyze a template that is made available for this purpose and <b> follow / apply </ b> rules / functions </ b> that will be presented below to <b> develop your own application quickly and intuitively </ b>.', NULL, NULL);
