INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(27, 'FollowTheModel', 'Para desenvolver uma nova aplicaรงรฃo para o sistema, o primeiro passo รฉ criar a pรกgina inicial dessa aplicaรงรฃo. <a href=template.php>Clique aqui</a> para visualizar e fazer o download de uma pรกgina de exemplo (essa pรกgina precisa ser colocada nessa pasta para que funcione corretamente, pois ela depende de arquivos que estรฃo disponibilizados na plataforma). No Cรณdigo abaixo, sรฃo mostradas as funรงรตes PHP que essa pรกgina utiliza:', 'To develop a new application for the system, the first step is to create the home page for that application. <a href=template.php> Click here </a> to view and download a sample page (this page needs to be placed in this folder in order for it to work correctly because it depends on the files that are available on the platform). In the Code below, the PHP functions that this page uses are shown:', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(28, 'WritingCode', 'No exemplo acima, pode-se observar a inclusรฃo do 3 scripts bรกsicos que incluem em sua pรกgina, os elementos essenciais para a utilizaรงรฃo da plataforma:\r\n</p>\r\n<ul>\r\n<li><b>config.php</b>: Com as principais configuraรงรตes da plataforma;</li>\r\n<li><b>functions.php</b>: Abastece a sua pรกgina com as funรงรตes disponรญveis na plataforma;</li>\r\n<li><b>security.php</b>: Como o prรณprio nome jรก sugere, รฉ o script responsรกvel pela seguranรงa. Nรฃo deixa o cรณdigo continuar se o usuรกrio nรฃo estiver logado;</li>\r\n</ul>\r\n<p>\r\nEm seguida vem o comando para abertura do Banco de Dados que serรก consumido no decorrer da pรกgina. ร interessante notar tambรฉm, as funรงรตes "<b>pageHeader</b>" e "<b>pageFooter</b>" que respectivamente auxiliam na montagem do cabeรงalho e rodapรฉ da pรกgina. Hรก ainda a funรงรฃo "<b>logWrite</b>" que escreve no Log de Eventos que a pรกgina foi acessada. Essas funรงรตes e muitas outras, estarรฃo melhor explicadas no tutorial <a href=functions.php>Funรงรตes รteis Disponรญveis</a>.\r\n</p>\r\n<p>\r\nAs pรกginas escritas em PHP misturam alรฉm dos prรณprios comandos PHP, as tags HTML e ocasionalmente cรณdigos Javascript e estilos CSS. ร recomendรกvel que nessas pรกgnas, todo esse conteรบdo seja escrito em PHP, ou seja, escrevendo as tags HTML e os cรณdigos Javascript e CSS utilizando o comando "<b>echo</b>" e a terminaรงรฃo de linha "<b>\\n</b>". Estรก comprovado que atravรฉs dessa notaรงรฃo, o cรณdigo รฉ executado com um pouco mais de rapidez, e fica muito mais fรกcil de ser mantido ou debugado.</p>\r\n<br /><p>Veja um exemplo mais completo:', 'Writing The Code', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(29, 'DownloadPage', 'Para fazer o download dessa pรกgina, <a href=files/template.zip>Clique Aqui</a>.', 'To download this page, <a href=files/template.zip> Click Here </a>.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(30, 'DataBaseFunctions', 'A plataforma oferece as funรงรตes bรกsicas para facilitar o acesso aos bancos de dados. No quadro abaixo รฉ mostrado todo o cรณdigo necessรกrio para listar os dados de um campo de uma tabela:', 'DataBase Functions', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(31, 'DataBaseConnection', 'Repare que para listar os dados da tabela, foi usada a funรงรฃo "<b>select()</b>", com os parรขmetros "<b>campos</b>", "<b>tabela</b>" e "<b>where</b>" (Opcional).</p>\r\n<p>\r\nA conexรฃo com o banco de dados รฉ feita atravรฉs da funรงรฃo "<b>openDB()</b>". Quando o banco de dados รฉ diferente do banco utilizado pelo sistema, รฉ possรญvel acessรก-lo utilizando os parametros com as informaรงรตes sobre o mesmo na respectiva ordem.', 'DataBase Connection', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(32, 'DataBaseInsert', 'Para inserir novos dados em uma tabela, รฉ usada a funรงรฃo "<b>insert()</b>", com os parรขmetros "<b>campos</b>" e "<b>tabela</b>". Os valores deverรฃo estar armazenados previamente em um "<b>array</b>".', 'DataBase Insert', NULL, NULL);
