INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(40, 'SystemUpgrade', 'Atualizaรงรฃo do Sistema', 'System Upgrade', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(41, 'TheNewWay', 'O desenvolvimento com <b>Cรณdigos Simples</b> tem ganhado popularidade entre as empresas que trabalham com a criaรงรฃo de sistemas. Essa estrutura de trabalho รฉ focada na plataforma em que o desenvolvimento e a implementaรงรฃo de um software sรฃo feitos com mais inteligรชncia, seguranรงa, agilidade e precisรฃo.', 'Development with <b> Simple Codes </ b> has gained popularity among companies working with systems design. This work structure is focused on the platform where the development and implementation of software is done with more intelligence, security, agility and precision.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(42, 'IncreasingProductivity', 'Aumento de Produtividade', 'Increasing Productivity', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(43, 'IncreasingProductivityExplain', 'Ter um time com alto nรญvel de produtividade รฉ um ponto-chave para atingir bons resultados. Se o negรณcio consegue manter um fluxo de trabalho รกgil e preciso, os erros sรฃo menos frequentes e os recursos passam a ter maior aproveitamento.', 'Having a team with a high level of productivity is a key to achieving good results. If the business manages to maintain an agile and accurate workflow, errors are less frequent and resources are better exploited.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(44, 'IntuitiveManagement', 'Gestรฃo mais Intuitiva', 'Intuitive Management', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(45, 'IntuitiveManagementExplain', 'O cรณdigo simples baseado na plataforma torna os processos de desenvolvimento e gestรฃo de softwares mais intuitivos. O cรณdigo passa a ter um nรญvel de complexidade muito menor, o que auxilia na verificaรงรฃo dos requisitos e na criaรงรฃo de novas funcionalidades.', 'The simple, platform-based code makes software development and management processes more intuitive. The code has a much lower level of complexity, which assists in checking requirements and creating new features.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(46, 'LowRisks', 'Reduรงรฃo de Riscos Durante o Processo de Desenvolvimento', 'Reducing Risks During the Development Process', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(47, 'LowRisksExplain', 'Todo sistema possui bugs e vulnerabilidades. Mas, para garantir que tenha o menor impacto possรญvel na qualidade da ferramenta que รฉ entregue ao usuรกrio, os gestores investem em uma sรฉrie de estratรฉgias que auxiliam os desenvolvedores a rastrear erros, corrigir vulnerabilidades de seguranรงa e eliminar os demais fatores que possam impactar negativamente na performance do software. Dessa forma, a aplicaรงรฃo que รฉ entregue terรก uma experiรชncia de usuรกrio de maior qualidade.</p><p>No cรณdigo simples baseado em plataforma, esses testes podem ser drasticamente diminuรญdos, pois a chance de erros รฉ muito menor.', 'Every system has bugs and vulnerabilities. But to ensure that it has the least possible impact on the quality of the tool delivered to the user, managers invest in a number of strategies that help developers track errors, fix security vulnerabilities, and eliminate other factors that may negatively impact performance of the software. In this way, the application that is delivered will have a higher quality user experience. </ P> <p> In simple platform-based code, these tests can be drastically reduced because the chance of errors is much lower.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(48, 'LowCosts', 'Diminuiรงรฃo dos Custos Operacionais', 'Decrease in Operating Costs', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(49, 'LowCostsExplain', 'O desenvolvimento com cรณdigo simples nรฃo requer investimento em softwares onerosos. Pois nรฃo tem necessidade de editores que garantam o fluxo entre diversos mecanismos de deploy ou sincronia. Tudo que o programador irรก precisar serรก um Editor de Cรณdigo, um Utilitรกrio para FTP e uma ferramenta para Auxรญlio para o Banco de Dados. Essas ferramentas sรฃo encontradas com facilidade em versรฃo de domรญnio pรบblico e atรก mesmo com cรณdigo aberto.</p><p>Em um cenรกrio de crise, reduzir custos pode ser o fator fundamental para que a empresa se mantenha rentรกvel. Quando os processos sรฃo executados exigindo menos recursos, a empresa pode manter a sua rotina de investimentos e garantir a sua capacidade de inovar.', 'Development with simple code does not require investment in expensive software. For there is no need for editors to guarantee the flow between several mechanisms of deploy or synchrony. All that the programmer will need is a Code Editor, an FTP Utility, and a Database Help tool. These tools are easily found in the public domain version and even open source. </ P> <p> In a crisis scenario, reducing costs can be the key factor in keeping the company profitable. When processes are run requiring less resources, the company can maintain its investment routine and ensure its ability to innovate.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(50, 'MoreScalability', 'Maior Escalabilidade', 'More Scalability', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(51, 'MoreScalabilityExplain', 'A escalabilidade รฉ a capacidade de o negรณcio ampliar ou reduzir a sua capacidade de trabalho e entrega de produtos a qualquer momento. Em um cenรกrio em que os clientes cobram por uma resposta รกgil a mudanรงas nas demandas de usuรกrios e parceiros comerciais, ser escalรกvel virou um fator diretamente relacionado com o sucesso de um produto.', 'Scalability is the ability of the business to expand or reduce its ability to work and deliver products at any time. In a scenario where customers charge for a responsive response to changes in the demands of users and business partners, scalability has become a factor directly related to the success of a product.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(52, 'TeamEngage', 'Aumento do Engajamento dos Desenvolvedores', 'Increased Developer Engagement', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(53, 'TeamEngageExplain', 'Desenvolvedores engajados sรฃo o ponto-chave para que o negรณcio possa atingir resultados e metas de mercado. Quando a empresa tem equipes comprometidas, o fluxo de trabalho se torna mais รกgil: todos buscam mecanismos mais eficazes para entregar resultados e, assim, garantir que a qualidade dos trabalhos desenvolvidos alcancem o resultado esperado.', 'Engaged developers are the key point for the business to achieve results and market goals. When the company has committed teams, the workflow becomes more agile: everyone looks for more effective mechanisms to deliver results and, thus, ensure that the quality of the work developed reaches the expected result.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(54, 'AccessSystemOptions', 'Acessando as Opรงรตes do Sistema', 'Accessing System Options', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(55, 'CustomAppearance', 'Personalizando o Sistema', 'Custom Appearance', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(56, 'DataBaseUpdate', 'Para atualizar dados existentes em uma tabela, รฉ usada a funรงรฃo "<b>update()</b>", com os parรขmetros "<b>campos</b>", "<b>tabela</b>" e "<b>where</b>" (Opcional). Os valores deverรฃo estar armazenados previamente em um "<b>array</b>".', 'To update existing data in a table, the "<b> update () </ b>" function is used, with the "<b> fields", "<b> table </ b>" and "<b> where </ b>" (Optional). The values must be previously stored in an "<b> array </ b>".', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(57, 'DataBaseDelete', 'Seguindo a regra, hรก tambรฉm a funรงรฃo "<b>delete()</b>" que permite a exclusรฃo de um registro da tabela. Os parรขmetos sรฃo "<b>tabela</b>" e a clรกusula "<b>where</b>".', 'Following the rule, there is also the "<b> delete () </ b>" function that allows deletion of a record from the table. The parameters are "<b> table </ b>" and the "<b> where </ b>" clause.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(58, 'DataBaseQuery', 'Quando necessรกrio, o programador pode utilizar uma "<b>query</b>" genรฉrica para resolver alguma questรฃo especรญfica. A funรงรฃo a ser utilizada รฉ a "<b>query()</b>", passando como parรขmetro a query SQL integral em sua sintaxe normal. Embora seja muito prรกtica, o uso dessa funรงรฃo nรฃo รฉ recomendada, pois pode trazer incompatibilidade quando houver uma mudanรงa no banco de dados utilizado (de "MySQL" para "PostGreSQL", por exemplo).', 'When needed, the programmer can use a generic "<b> query </ b>" to solve some specific question. The function to be used is "<b> query () </ b>", passing as parameter the integral SQL query in its normal syntax. Although very practical, the use of this function is not recommended, as it can bring incompatibility when there is a change in the database used (from "MySQL" to "PostGreSQL", for example).', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(59, 'DataBaseQueryDebug', 'Um recurso extremamente รบtil para "debugar", รฉ o parametro final (opcional), que funciona em todas as funรงรตes descritas anteriormente: Inclua o parรขmetro "1" para que a funรงรฃo ao invรฉs de executar, apenas exiba na tela a query SQL resultante e interrompa o programa. ', 'An extremely useful feature for "debugging" is the final (optional) parameter, which works in all the functions described above: Include the parameter "1" so that the function instead of executing only displays the resulting SQL query and stop the program.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(60, 'UsingPermissionsOne', 'O recurso de permissรตes possibilita ao sistema, definir quais os recursos que podem ser acessados por cada grupo de usuรกrio. Por exemplo: Um usuรกrio cadastrado como <b>Administrador</b> pode alterar os dados dos demais usuรกrios; um usuรกrio cadastrado como <b>Operador</b> nรฃo terรก acesso ao sistema de cadastro de usuรกrios. E assim por diante...', 'The permissions feature enables the system to define which resources can be accessed by each user group. For example: A user registered as <b> Administrator </ b> can change the data of other users; a user registered as <b> Operator </ b> will not have access to the user registration system. And so on...', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(61, 'UsingPermissionsTwo', 'Essa "<b>permissรฃo</b>" รฉ colocada no cรณdigo. A sintaxe estรก exemplificada acima. No caso, รฉ verificado se o usuรกrio que estรก logado (a funรงรฃo conhece o ID do usuรกrio) tem a permissรฃo para "Ver" ("<b>View</b>") o cรณdigo protegido. Esse cรณdigo รฉ nomeado no caso, como "<b>UsersReport</b>" ("Relatรณrio de Usuรกrios"). A "permissรฃo" รฉ checada perante a tabela do banco de dados "<b>syspermissions</b>" que trarรก o resultado "Verdadeiro" ou "Falso", dependendo do que estiver cadastrado nessa tabelela, atravรฉs do <b>Cadastro de Permissรตes</b> do sistema.</p>\r\n<p><b>Nota</b>: Quando o programador cria uma nova permissรฃo, ela รฉ automaticamente inserida na tabela "<b>syspermissions</b>" como habilitada para qualquer usuรกrio. Depois ela pode ser alterada para cada grupo de usuรกrios atravรฉs do <b>Cadastro de Permissรตes</b> do sistema.', 'This "<b> permission </ b>" is placed in the code. The syntax is exemplified above. In this case, it is checked whether the user who is logged in (the function knows the user ID) has the "View" ("<b> View </ b>") permission to the protected code. This code is named in the case, such as "<b> UsersReport </ b>" ("User Report"). The "permission" is checked against the database table "<b> syspermissions </ b>" which will give the "True" or "False" result, depending on what is registered in that table, through <b> Permissions </ b>. </ P>', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(62, 'UsingTranslationOne', 'Existe no sistema a tabela "<b>syslanguages</b>". Nela, estรฃo as traduรงรตes para centenas de expressรตes utilizadas nos scripts que compรตem o sistema. Por padrรฃo, existem as lรญnguas Portuguรชs e Inglรชs jรก preenchidas. Mas o nรบmero de lรญnguas possรญveis รฉ ilimitado: Basta acrescentar uma coluna de um novo idioma nessa tabela.', 'There exists in the system the table "<b> syslanguages </ b>". In it are the translations for hundreds of expressions used in the scripts that make up the system. By default, Portuguese and English already exist. But the number of possible languages is unlimited: Just add a column of a new language in this table.', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(63, 'UsingTranslationTwo', 'O cรณdigo, como visto acima, รฉ extremamente simples: Uma simples funรงรฃo que traduz a expressรฃo passada como parรขmetro para a linguagem selecionada no login do sistema. na programaรงรฃo, cada nova palavra ou expressรฃo inserida para traduรงรฃo, รฉ automรกticamente adicionada na tabela. A nova palavra ou expressรฃo pode ser traduzida para os idiomas cadastrados atravรฉs do mรณdulo de <b>Gerenciamento de Linguagem</b>.', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(64, 'EventsLogOne', 'O recurso de gravar os eventos ocorridos no sistema รฉ de imensa utilidade em diversos sentidos. A plataforma oferece uma funรงรฃo especรญfica para essa finalidade. Ela pode ser utilizada ao final de cada pรกgina ou ao tรฉrmino de cada operaรงรฃo que se deseja que fique registrada.', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(65, 'EventsLogTwo', 'A sintaxe รฉ extraordinรกriamente simples: Basta usar a funรงรฃo "<b>logWrite()</b>" contento os parรขmetros preenchidos de acordo com sua necessidade. O primeiro parรฃmetro รฉ obrigatรณrio: descreve a aรงรฃo ocorrida. O segundo parรขmetro, ao gupo a que essa aรงรฃo pertence. No caso "Ver" ("<b>View</b>"), "Tutorial Pรกgina 1" ("<b>TutorialPage1</b>").', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(66, 'EventsLogTree', 'Mas nรฃo para por aรญ. Outros parรขmetros opcionais podem enriquecer os dados armazenados. No tutorial sobre <a href=database.php>Banco de Dados</a>, na demonstraรงรฃo da funรงรฃo "<b>delete()</b>", foi colocada a funรงรฃo "<b>logWrite</b>" quando a operaรงรฃo fosse corretamente efetuada. Veja o cรณdigo acima.', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(67, 'EventsLogFour', 'No cรณdigo acima, estรก mostrada a primeira linha da funรงรฃo, com todos os seus parรขmetros existentes. ร fรกcil deduzir a finalidade de cada um. Apenas um detalhe: Os dois รบltimos ("UserID" e "CompanyID") quando nรฃo preenchidos, guardam os dados do usuรกrio que estรก operando o sistema. Podem ser preenchidos opcionalmente quando necessรกrio registrar um evento de um outro usuรกrio.</p>\r\n<p><b>Nota</b>: Os registros ficam armazenados na tabela "<b>sysevents</b>", com campos adicionais, automaticamente preenchidos como: Data do Evento, Caracterรญsticas do Navegador do usuรกrio etc.. ', '', NULL, NULL);
