INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(80, 'AccessSystemOptionsOne', 'No mรณdulo "<b>Opรงรตes do Sistema</b>", o usuรกrio pode selecionar alumas opรงรตes que alteram o comportamento do sistema. Novas opรงรตes podem ser criadas pelo programador, como veremos a frente. Observe o cรณdigo: ', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(81, 'AccessSystemOptionsTwo', 'Essa consulta ร "<b>opรงรฃo</b>" รฉ colocada no cรณdigo. A sintaxe estรก exemplificada acima. No caso, . O valor retornado pela consulta ร "opรงรฃo" รฉ checada na tabela do banco de dados "<b>sysoptions</b>".</p>\r\n<p><b>Nota 1</b>: Quando o programador cria uma nova consulta ร opรงรฃo, ela รฉ automaticamente inserida na tabela "<b>sysoptions</b>". Depois ela pode ser alterada atravรฉs do mรณdulo "<b>Opรงรตes do Sistema</b>".\r\n<p><b>Nota 2</b>: O mรณdulo <b>Preferรชncias do Usuรกrio</b> funciona de forma idรชntica, e guarda os dados na tebela "<b>syspreferences</b>". A diferenรงa entre "<b>Opรงรตes do Sistema</b>" e "<b>Preferรชncias do Usuรกrio</b>" รฉ que as opรงรตes aplicam-se ao sistema e todos os seus usuรกrios enquanto as preferรชncias referem-se a cada usuรกrio.', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
	(82, 'CustomAppearanceOne', 'Todos os arquivos ("css" e imagens) que sรฃo usados para compor o visual do sistema estรฃo na pasta "<b>\\assets</b>", localizada na raiz do diretรณrio. Os arquivos estรฃo organizados em pastas de acordo com sua funรงรฃo. Os arquivos que podem ser alterados ("css" e imagens) tem em seu nome a expressรฃo "-template". Esses arquivos sรฃo carregados quando nรฃo existem os homรดnimos sem a expressรฃo mencionada. Ou seja, se vocรช inserir na pasta "<b>\\css</b>", um arquivo "<b>login.css</b>" ele serรก carregado no lugar do "<b>login-template.css</b>". Dessa forma, o arquivo poderรก ser alterado sem que seja substituido na atualizaรงรฃo do sistema.</p>\r\n<p>O sistema foi desenvolvido de maneira que seja apenas necessรกrio mudar as imagens e as folhas de estilo para que todo o visual seja modificado. Veja esse estilo alternativo para a pรกgina de "<b>login</b>": ', '', NULL, NULL);
INSERT INTO `systutorial` (`ItemID`, `ItemCode`, `BR`, `EN`, `FR`, `ES`) VALUES
